import React, { Component } from "react";
import { connect } from "react-redux";

class ProductList extends Component {
  render() {
    const { products } = this.props;
    console.log(products);

    const ul = (
      <ul>
        {products.map(ele => (
          <li key={ele.id}>
            <p>商品名称：</p>
            {ele.proName}
            <button>加入购物车</button>
          </li>
        ))}
      </ul>
    );
    return <div>{ul}</div>;
  }
}

export default ProductList;
